import Layout from "../components/Layout";
import {Button} from 'react-bootstrap'

function Kurumsal() {
 return (
  <Layout title={"Kurumsal"} headText={"Kurumsal"}>
   <Button variant="success">Success</Button>
  </Layout>
 );
}

export default Kurumsal;
